import ubinascii, os, machine,uhashlib
from ubinascii import hexlify

encoded=(('pyhuskylens.mpy', ('\n', '\n', '\n', '\n', '\n'), '9a5ba7d8e1959169f9f36f3d46a1ecd149602bb76cdc109f4f2931e5e70d42c8'), ('__init__.mpy', ('TQUCHyAkAAoABzwuLi9tcHlfcm9ib3RfdG9vbHMvX19pbml0X18ucHkAUWMAAA==\n',), 'bd0eb1ec00392c81347ab95950ebc33661aa1cb23009054638ed4cbea66fcc3e'), ('bt.mpy', ('\n', '\n', '\n', '\n', '\n', '\n', '\n', '\n', '\n', '\n', '\n', '\n'), '6cbd539872eb242a6b808eda9d20a0bc47df92597e33033d21bec122822e9589'), ('light_matrix.mpy', ('\n', '\n', 'VxMFsBMFsBMFVYBV5VoYBbBXEwOB5VoYAbATARIAa7ATBTQB20QFgICwGAMSMxQIc2hvdxIlECcUAGgyArI0ATYBNAE2AVlRYwABAIkIdGltZYEQUQ4nHZAKACsAsF9LEwDBEAABFABoMgGxNAE2AS8UQup/YwABAAV0QQ4DA5AKACsAsF9LDADBEgCXsTQBLxRC8X9jAAAABQ==\n'), '840f1af2a2068017d08d8f3315a3eab73db21021a79a571463fb49236e801974'), ('helpers.mpy', ('\n',), '636b2876d260877dc288b50a257e4a8a4459c7ad43acc8c2fbd671942f16a17a'), ('motor_sync.mpy', ('\n', '\n', '\n'), 'ff07c3fee21207cebf5f313c0b261fe5352db2569387c656aaa956accad9fa63'))

def calc_hash(b):
    return hexlify(uhashlib.sha256(b).digest()).decode()

error=False
try:
    os.mkdir('/projects/mpy_robot_tools')
except:
    pass

for file, code, hash_gen in encoded:
    print("Writing file ", file)
    # hash_gen=code[1]
    target_loc = '/projects/mpy_robot_tools/'+file
    
    print('writing '+file+' to folder /projects/mpy_robot_tools')
    with open(target_loc,'wb') as f:
        for chunk in code:
            f.write(ubinascii.a2b_base64(chunk))

    print('Finished writing '+file+', Checking hash.')
    result=open(target_loc,'rb').read()
    hash_check=calc_hash(result)

    print('Hash generated: ',hash_gen)

    if hash_check != hash_gen:
        print('Failed hash of .mpy on SPIKE: '+hash_check)
        error=True

if not error:
    print('Library written succesfully. Resetting....')
    machine.reset()
else:
    print('Failure in writing library!')